function findBoard(){var string = []; var gmtcolc = document.getElementsByClassName('gm-tcol-c'); for (var i=0, leng=gmtcolc.length ; i < leng ; i++) if (gmtcolc[i].outerHTML.indexOf('cafe_main') !== -1 && gmtcolc[i].outerHTML.indexOf('ArticleList.nhn?search.clubid=') !== -1 && gmtcolc[i].outerHTML.indexOf('Favorite') === -1) string.push(gmtcolc[i].innerHTML); window.external.findBoard(string.join(','));}